import React from "react";
import Navbar from "../navbar/Navbar";
import NavbarJury from "../navbar/NavbarJury";

function IsUser(props){
    console.log(props.ROLES)
    if (props.ROLES === true || props.ROLES === false) {
      return (
             props.ROLES[0] ? 
              <NavbarJury/>
             : 
              <Navbar/>
            
            
      )
    } else {
      return null
    } 
}

export default IsUser;
